#!/usr/bin/python

# Sequência de DNA
dna_sequence = ("")

# Contando nucleotídeos
nt_comp = {}
for nucleotidio in set(dna_sequence):  # Usando set para obter caracteres únicos
    nt_comp[nucleotidio] = dna_sequence.count(nucleotidio)

# Cálculo da composição de nucleotídeos e conteúdo GC
total_nucleotideos = sum(nt_comp.values())
conteudo_gc = (nt_comp.get('G', 0) + nt_comp.get('C', 0)) / total_nucleotideos * 100

# Exibindo resultados
print("\nContagem de Nucleotídeos:")
for nt, contagem in nt_comp.items():
    print(f"{nt}: {contagem}")

print(f"\nComposição total de nucleotídeos: {total_nucleotideos}")
print(f"Conteúdo de GC: {conteudo_gc:.2f}%")

